import * as React from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import { useHistory } from 'react-router';
import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import DeleteOutlineOutlinedIcon from '@material-ui/icons/DeleteOutlineOutlined';
import EditIcon from '@material-ui/icons/Edit';

import CircularProgress from '@material-ui/core/CircularProgress';
import Tooltip from '@mui/material/Tooltip';
const useStyles = makeStyles({

  container: {
    maxHeight: 440,
  },
  loader: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
});


const MedicosTabla = ({ medicosList , isFetching}) => {
  const classes = useStyles();

  let history = useHistory();


  const StyledTableCell = withStyles((theme) => ({
    head: {
      backgroundColor: '#1976d2',
      color: theme.palette.common.white,
    },
    body: {
      fontSize: 14,
    },
  }))(TableCell);


  function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
  }

  return (
    <>
    <TableContainer className={classes.container}>
      <Table stickyHeader >
        <TableHead     >
          <TableRow >
            <StyledTableCell align="left"  >Nombre y Apellido</StyledTableCell>
            <StyledTableCell align="right">Email</StyledTableCell>
            <StyledTableCell align="right">Celular</StyledTableCell>
            <StyledTableCell align="right" ></StyledTableCell>
            <StyledTableCell align="right" ></StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody> 
          {medicosList && medicosList.map((row, index) => (
            <TableRow hover>
              <TableCell align="left">
                {row.nombre} {row.apellido}
              </TableCell>
              <TableCell align="right">{row.email}</TableCell>
              <TableCell align="right">{row.celular}</TableCell>
              <TableCell align="right">
                <Tooltip title="Editar" placement="right">
                  <EditIcon />
                </Tooltip>
              </TableCell>
              <TableCell align="left">
                <Tooltip title="Eliminar" placement="right">
                  <DeleteOutlineOutlinedIcon />
                </Tooltip>
              </TableCell>
            </TableRow>
          ))}
        </TableBody> 
      </Table>
    </TableContainer>
       { <CircularProgress size={24}   className={classes.loader} /> }
       </>
  );
}
export default MedicosTabla;
